"""##**Convolutional Neural Network**"""

# ✅ Define a Sequential Model (Stacking Layers One-by-One)
model = models.Sequential()

# ✅ First Convolutional Layer
# - 64 filters (small patterns learned from images)
# - 3x3 kernel size (small region scanned at a time)
# - ReLU activation (introduces non-linearity)
# - Input shape: (img_size, img_size, 3) → Image size with 3 color channels (RGB)
model.add(layers.Conv2D(32, (3, 3), activation='relu', input_shape=(img_size, img_size, 3)))

# ✅ First MaxPooling Layer (Downsampling)
# - Reduces feature map size by 2x2 (Retains important features while reducing complexity)
model.add(layers.MaxPooling2D(2, 2))

# ✅ Second Convolutional Layer
# - 128 filters (detects more complex patterns)
# - 3x3 kernel size (same small region scan)
# - ReLU activation
model.add(layers.Conv2D(64, (3, 3), activation='relu'))

# ✅ Second MaxPooling Layer (Further Downsampling)
# - Reduces size further while retaining important features
model.add(layers.MaxPooling2D(2, 2))

# ✅ Flatten Layer
# - Converts 2D feature maps into a 1D vector (needed before passing to Dense layers)
model.add(layers.Flatten())

# ✅ Fully Connected Layer (Dense Layer)
# - 256 Neurons (processes extracted features for classification)
# - ReLU activation (introduces non-linearity for better learning)
model.add(layers.Dense(256, activation='relu'))

# ✅ Output Layer (Final Classification)
# - Uses 'softmax' activation (for multi-class classification)
# - `train_generator.num_classes` ensures the number of output neurons matches the dataset's classes
model.add(layers.Dense(num_of_classes, activation='softmax'))

# model summary
model.summary()

# Compile with Optimized Settings
model.compile(
    optimizer=  keras.optimizers.Adam(),
    loss='categorical_crossentropy',
    metrics=['accuracy',
             keras.metrics.Precision(name='precision'),
             keras.metrics.Recall(name='recall')]
)

# Add callbacks
callbacks = [
    EarlyStopping(monitor='val_loss', patience=3, verbose=1, restore_best_weights=True),
    ReduceLROnPlateau(monitor='val_loss', factor=0.1, patience=1, verbose=1),
    ModelCheckpoint('best_model.h5', monitor='val_loss', save_best_only=True, verbose=1)
]

# Train the Model
history = model.fit(
    train_generator,
    epochs=10,
    validation_data=validation_generator,
    callbacks=callbacks
)

"""##**Evaluate Performance**"""

def plot_training(hist):
    '''
    This function takes a trained model's history and plots the accuracy and loss over epochs.
    '''

    # ✅ Extract training & validation metrics from the history object
    tr_acc = hist.history['accuracy']         # Training accuracy per epoch
    tr_loss = hist.history['loss']            # Training loss per epoch
    val_acc = hist.history['val_accuracy']    # Validation accuracy per epoch
    val_loss = hist.history['val_loss']       # Validation loss per epoch

    # ✅ Find the best epoch based on the lowest validation loss
    index_loss = np.argmin(val_loss)   # Index of epoch with lowest validation loss
    val_lowest = val_loss[index_loss]  # Lowest validation loss value

    # ✅ Find the best epoch based on the highest validation accuracy
    index_acc = np.argmax(val_acc)     # Index of epoch with highest validation accuracy
    acc_highest = val_acc[index_acc]   # Highest validation accuracy value

    # ✅ Create a list of epochs (1-based indexing)
    Epochs = [i + 1 for i in range(len(tr_acc))]

    # ✅ Create labels to highlight the best epochs
    loss_label = f'Best epoch = {str(index_loss + 1)}'
    acc_label = f'Best epoch = {str(index_acc + 1)}'

    # ✅ Plot the training and validation history
    plt.figure(figsize=(20, 8))    # Set figure size
    plt.style.use('fivethirtyeight')  # Apply visualization style

    # 📌 Plot Training & Validation Loss
    plt.subplot(1, 2, 1)   # Create subplot (1st plot in a row of 2)
    plt.plot(Epochs, tr_loss, 'r', label='Training Loss')   # Training loss curve
    plt.plot(Epochs, val_loss, 'g', label='Validation Loss') # Validation loss curve
    plt.scatter(index_loss + 1, val_lowest, s=150, c='blue', label=loss_label) # Mark best epoch
    plt.title('Training and Validation Loss')   # Plot title
    plt.xlabel('Epochs')   # X-axis label
    plt.ylabel('Loss')     # Y-axis label
    plt.legend()           # Show legend

    # 📌 Plot Training & Validation Accuracy
    plt.subplot(1, 2, 2)   # Create subplot (2nd plot in a row of 2)
    plt.plot(Epochs, tr_acc, 'r', label='Training Accuracy')   # Training accuracy curve
    plt.plot(Epochs, val_acc, 'g', label='Validation Accuracy') # Validation accuracy curve
    plt.scatter(index_acc + 1, acc_highest, s=150, c='blue', label=acc_label) # Mark best epoch
    plt.title('Training and Validation Accuracy')   # Plot title
    plt.xlabel('Epochs')   # X-axis label
    plt.ylabel('Accuracy') # Y-axis label
    plt.legend()           # Show legend

    plt.tight_layout()  # Adjust layout for better spacing
    plt.show()          # Display the plots

# 📌 Call the function to visualize training performance
